import React, { Component } from 'react';
import ReactDom from 'react-dom';
import axios from 'axios';
//引入组件
import { Layout } from 'antd';
import Content_first from './components/Content/目标转化事件/index';
import Content_second from './components/Content/待归因事件/index';
import Content_third from './components/Content/过程事件/index';
import Content_fourth from './components/Content/查看方式/index';
import DataUplode from './components/Footer/DataUplode/index';
//引入图标
import { SendOutlined } from '@ant-design/icons';
//引入css文件
import 'antd/dist/antd.css';
import './style.css';

const { Header, Footer, Content} = Layout;

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            events: [],
            attrs: [],
            values: []
        }

    }

    componentDidMount() {
        //接口请求数据
        //events
        axios.get('/events')
            .then((res) => {
                this.setState({
                    events: res.data
                })
                // console.log(this.state.events)
            })
            .catch((err) => {
                console.log(err)
            })
        //attrs
        axios.get('/attrs')
            .then((res) => {
                this.setState({
                    attrs: res.data
                })
                // console.log(this.state.attrs)
            })
            .catch((err) => {
                console.log(err)
            })
        //values
        axios.get('/values')
            .then((res) => {
                this.setState({
                    values: res.data
                })
                // console.log(this.state.values)
            })
            .catch((err) => {
                console.log(err)
            })
        //接收数据
        axios.post('/results')
            .then((res) => {
                console.log(res)
            })
            .catch((err) => {
                console.log(err)
            })

    }
    render() {
        return (
            <Layout className='layout'>
                <Header className='header'>
                    归因分析
                </Header>
                <form action='http://172.20.10.3:8090/result' method='post'>
                    <Content className='content'>
                        <h1 className='primarytitle'><SendOutlined className='icon icon_top' />选择事件</h1>
                        <div id='top'>
                            <div className='contentfirst'>
                                <span className='secondarytitle span'>目标转化事件：</span>
                                <Content_first events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='contentsecond'>
                                <p className='secondarytitle'>待归因事件：</p>
                                <Content_second  events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='contentthird'>
                                <p className='secondarytitle'>过程事件：</p>
                                <Content_third  events={this.state.events} attrs={this.state.attrs} />
                            </div>
                            <div className='contentfourth'>
                                <p className='secondarytitle'>查看方式：</p>
                                <Content_fourth  values={this.state.values} />
                            </div>
                        </div>
                        <hr></hr>                                   
                            <div className='contentfifth'>
                                <DataUplode />  
                            </div>
                    </Content>
                </form>
                <Footer className='footer'>

                </Footer>
            </Layout>
        )
    }
}

ReactDom.render(<App />, document.getElementById('root'))
